script: |
  super -f text -I q8654.spq | sort > q8654.out

inputs:
  - name: q8654.spq
    data: |
      SELECT DISTINCT col2 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - - 48 * col1 * + - col1 AND - col2 + 48 + + ( - col2 ) * - - CAST ( NULL AS INTEGER );
  - name: tab0

outputs:
  - name: q8654.out
    data: |
